import React, { useEffect } from 'react'
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate,
  useNavigate
} from 'react-router-dom';
import {v4 as uuidV4} from 'uuid';

import TextEditor from './TextEditor';

function App() {

  useEffect(() => {
    const navigate = useNavigate();
    navigate(`/documents/${uuidV4()}`)
  }, [])

  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/documents/:id">
            <TextEditor />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
